import { BrowserRouter as Router, Link } from 'react-router-dom';
import React from 'react';
import './NavBar.css';

const NavBar = () => {
  return (
    <div className='hero'>
      <Router>
        <nav>
          <h2 className='logo'>Learn<span>ify</span></h2>
          <ul>
            <li><Link to='/'>Home</Link></li>
            <li><Link to='/about'>About</Link></li>
            <li><Link to='/footer'>Contact</Link></li>
          </ul>
          <Link to='/login'>
          <button type='button' className='button-login'>
            Login
          </button>
        </Link>
        </nav>
      </Router>
      <div className='title'>
        <h1 className='heading'>Learnify</h1>
        <h3 className='subheading'>Unlocking the power of knowledge, together</h3>
      </div>
    </div>
  );
};

export default NavBar;
